/* see osa on Bright Focus (for buttons, links, and textboxes)
by http://userstyles.org/user/show/3 */

*:focus {
  -moz-outline: 2px solid #FC9C00 !important;
  -moz-outline-offset: 1px !important;
  -moz-outline-radius: 3px !important;
}

button:focus,
input[type="reset"]:focus,
input[type="button"]:focus,
input[type="submit"]:focus,
input[type="file"] > input[type="button"]:focus {
  -moz-outline-radius: 5px !important;
}

button:focus::-moz-focus-inner {
  border-color: transparent !important;
}

button::-moz-focus-inner,
input[type="reset"]::-moz-focus-inner,
input[type="button"]::-moz-focus-inner,
input[type="submit"]::-moz-focus-inner,
input[type="file"] > input[type="button"]::-moz-focus-inner {
  border: 1px dotted transparent !important;
}
textarea:focus, button:focus, select:focus, input:focus {
  -moz-outline-offset: -1px !important;
}
input[type="radio"]:focus {
  -moz-outline-radius: 12px;
  -moz-outline-offset: 0px !important;
}
a:focus {
  -moz-outline-offset: 0px !important;

